import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaHeartbeat, FaWheelchair, FaBrain, FaHandsHelping, FaPhone, FaMapMarkerAlt } from 'react-icons/fa';
import './Dashboard.css'; // Assuming you have corresponding styles

const Dashboard = () => {
  const navigate = useNavigate();
const cards = [
  {
    title: 'Cardiac Rehab',
    icon: <FaHeartbeat size={40} className="text-red-500" />, // red
    condition: 'Cardiac Condition',
    description: 'Improve your heart health with guided exercises.',
    button: 'Start',
    route: '/exercise/cardiac',
  },
  {
    title: 'Orthopedic Rehab',
    icon: <FaWheelchair size={40} className="text-blue-600" />, // blue
    condition: 'Joint Recovery',
    description: 'Rebuild strength after orthopedic procedures.',
    button: 'Start',
    route: '/exercise/orthopedic',
  },
  {
    title: 'Neuro Rehab',
    icon: <FaBrain size={40} className="text-purple-600" />, // purple
    condition: 'Neurological Recovery',
    description: 'Support neuroplasticity through movement.',
    button: 'Start',
    route: '/exercise/neuro',
  },
  {
    title: 'Physiotherapy',
    icon: <FaHandsHelping size={40} className="text-green-600" />, // green
    condition: 'Full-body Mobility',
    description: 'Maintain flexibility and functional movement.',
    button: 'Start',
    route: '/exercise/physio',
  },
  {
    title: 'Contact Us',
    icon: <FaPhone size={40} className="text-orange-500" />, // orange
    condition: 'We care about you',
    description: 'Reach out to our rehab experts anytime.',
    button: 'Know More',
    route: '/contact',
  },
  {
    title: 'Best Rehab Center',
    icon: <FaMapMarkerAlt size={40} className="text-pink-600" />, // pink
    condition: 'Find Near You',
    description: 'Discover top-rated rehab centers nearby.',
    button: 'Find',
    route: '/rehab-center',
  },
];



  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <h1>AI Rehab Dashboard</h1>
      </header>
      <div className="card-grid">
        {cards.map((card, index) => (
          <div key={index} className="card shadow hover:shadow-lg transition duration-300">
            <div className="card-icon">{card.icon}</div>
            <h3 className="card-title">{card.title}</h3>
            <span className="card-condition">{card.condition}</span>
            <p className="card-description">{card.description}</p>
            <button
              className="card-button"
              onClick={() => navigate(card.route)}
            >
              {card.button}
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
